import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import { store } from './_helpers';
import './index.css';
import {App} from './App';

import jwt from 'jsonwebtoken'
import {userActions} from './_actions'




import { LoginPage } from './components/LoginPage';
import  {RegisterPage}  from './components/RegisterPage/RegisterPage';
import { HomePage } from './components/HomePage';
import { Route,Redirect, Switch, BrowserRouter as Router } from 'react-router-dom'  
import { PrivateRoute } from './components/PrivateRoute';

import {changePassword} from './components/changePasswordPage/changePassword';





// check user authentication here
if (localStorage.getItem('user-auth')) {
  //setAuthorizationToken(localStorage.jwtToken)
  store.dispatch(userActions.setCurrentUser(jwt.decode(localStorage.getItem('user-auth'))))
}

ReactDOM.render(
  <React.StrictMode>
   <Provider store={store}>
      <App>
      <Router>
        <Switch>
            <PrivateRoute exact path="/" component={HomePage} />
            <PrivateRoute exact path="/changepassword" component={changePassword} />
            <Route  path="/login" component={LoginPage} />
            <Route  path="/register" component={RegisterPage} />
            {/* <PrivateRoute  path="/forgotpass" component={forgotpassword} /> */}
            <Redirect from="*" to="/login" />
        </Switch>
       </Router>
      </App> 
   </Provider> 
  </React.StrictMode>,
  document.getElementById('root')
);

